import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Navbar = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    sessionStorage.clear();
    navigate('/login');
  };

  const styles = {
    navbar: {
      background: '#2a2a2a',
      padding: '15px 30px',
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      position: 'fixed',
      top: 0,
      width: '100%',
      zIndex: 1000,
      boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
    },
    navLinks: {
      display: 'flex',
      alignItems: 'center',
      gap: '10px',
    },
    navLink: {
      color: 'white',
      textDecoration: 'none',
      padding: '10px 20px',
      borderRadius: '25px',
      fontWeight: 'bold',
      transition: 'all 0.3s ease',
      background: 'rgba(255, 255, 255, 0.1)',
      cursor: 'pointer',
    },
    logo: {
      color: 'white',
      fontSize: '25px',
      fontWeight: 'bold',
      textDecoration: 'none',
    },
    welcomeText: {
      color: 'white',
      fontSize: '16px',
      marginRight: '45px',
      cursor: 'pointer', 
    },
  };

  return (
    <header style={styles.navbar}>
      <Link to="/UserProductViews" style={styles.logo}>
        Online Medical Shop
      </Link>
      <nav style={styles.navLinks}>
        {/* Only show certain links if the user is logged in */}
        {sessionStorage.getItem('user_id') ? (
          <>
            <div style={styles.navLink} onClick={() => navigate('/mybooking')}>
              View Bookings
            </div>
            <div
              style={styles.navLink}
              onClick={() => navigate('/ChangePassword')}
            >
              Change Password
            </div>
            <span style={styles.welcomeText} onClick={handleLogout}>
              <i className="bi bi-person-circle"></i> Welcome,{' '}
              {sessionStorage.getItem('name')}
            </span>
          </>
        ) : (
          <Link to="/login" style={styles.navLink}>
            <i className="bi bi-person-circle"></i> Login / Register
          </Link>
        )}
      </nav>
    </header>
  );
};

export default Navbar;
